useEffect(() => {
  const fetchFlights = async () => {
    try {
      const res = await axios.get('/api/flights', {
        params: {
          from: 'Delhi',
          to: 'Mumbai',
          date: '2025-04-15',
        },
      });
      setFlights(res.data);
    } catch (err) {
      console.error('Error fetching flights:', err);
    }
  };

  fetchFlights();
}, []);
